import React from 'react';
import GenericForm from './GenericForm';
import { TipoEntidadModel } from './Models/TipoEntidadModel';


export default function TipoEntidadForm() {
    
    return (<GenericForm
        formName='Tipo de entidad'
        service='mas-tipo-entidad'
        model={TipoEntidadModel}
        successRedirect='/TipoEntidad'
    />
    );
    
    
};
